function(num) {
  // For values close to zero, round to 0
  if (Math.abs(num) < 0.05) {
    return 0;
  }
  // For numbers < 10, round to two decimal places unless very close to the next whole number
  if (num < 10) {
    var roundedNum = Math.round(num * 100) / 100;

    // Special check: If the decimal part is 0.995 or more, round up to the next integer
    if (num - Math.floor(num) >= 0.995) {
      return Math.ceil(num); // Round up to the nearest integer
    }
    return roundedNum;
  }
  // For numbers >= 10, round to the nearest integer
  return Math.round(num);
}

